import React from 'react';
import ReactDOM from 'react-dom';
import { FirebaseAppProvider } from 'reactfire';
import App from './App';
import { ContextProvider } from './Context';
import './styles.css';

const firebaseConfig = {
  apiKey: "AIzaSyDE1xiw69lK63GjjUwaJkly-UkZ84GlF5M",
  authDomain: "react-webrtc-be08d.firebaseapp.com",
  projectId: "react-webrtc-be08d",
  storageBucket: "react-webrtc-be08d.appspot.com",
  messagingSenderId: "720224266375",
  appId: "1:720224266375:web:c3234ea1550175f54db022"
};

ReactDOM.render(
  <FirebaseAppProvider firebaseConfig={firebaseConfig}>
    <ContextProvider>
      <App />
    </ContextProvider>
  </FirebaseAppProvider>,
  document.getElementById('root'),
);
